description:
Deception
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Detective Alicia Wallace (Asa Akira) is a valuable and respected officer on the LAPD... until her husband is murdered. With a crime hitting so close to home and no leads in sight, accusations begin to fly. Even her own partner suspects something is amiss. When an escaped criminal resurfaces, no one is prepared for just how deep the deception runs.

Cast: Asa Akira , Kleio Valentien , Abigail Mac , Kalina Ryu , Sheena Ryder , Seth Gamble , Tommy Pistol , Eric Masterson , Jack Vegas , Stormy Daniels,  Director

Categories: Feature Prebooks

